webpackJsonp([0x5baea3b4eaa6],{2124:function(e,s){e.exports={pathContext:{docHtml:'<h1>builtin-modules <a href="https://travis-ci.org/sindresorhus/builtin-modules"><img src="https://travis-ci.org/sindresorhus/builtin-modules.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>List of the Node.js builtin modules</p>\n</blockquote>\n<p>The list is just a <a href="builtin-modules.json">JSON file</a> and can be used wherever.</p>\n<h2>Install</h2>\n<pre><code>$ npm install --save builtin-modules\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">var builtinModules = require(\'builtin-modules\');\n\nconsole.log(builinModules);\n//=> [\'assert\', \'buffer\', ...]\n</code></pre>\n<h2>API</h2>\n<p>Returns an array of builtin modules fetched from the running Node.js version.</p>\n<h3>Static list</h3>\n<p>This module also comes bundled with a static array of builtin modules generated from the latest Node.js version. You can get it with <code>require(\'builtin-modules/static\');</code></p>\n<h2>Related</h2>\n<ul>\n<li><a href="https://github.com/sindresorhus/is-builtin-module">is-builtin-module</a> - Check if a string matches the name of a Node.js builtin module</li>\n</ul>\n<h2>License</h2>\n<p>MIT Â© <a href="http://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/builtin-modules/readme",proj:"argo-ci"}}}});
